import React from 'react';
import styles from './styles/Playlist.module.css'


// aici mai adaugam o <ol> list formata din ce am selecat din result list
function Playlist(){
    return(
        <div className={styles.playlistDiv}>
             <h2 className={styles.h2}>Playlist</h2>
             <ol>
             {songs.map((song)=>(
                  <li key={song.id} className={styles.liSong}> 
                    <p>{song.title} {song.album}</p>
                    <audio controls src={song.preview} ></audio>
                    <button onClick={onClickHandle}>+</button>
                  </li>
              ))}     
             </ol>
        </div>
    );
}

export default Playlist;
